e to classify things. For example: a taxonomy named "Art" can have multiple terms, such as "Modern" and "18th Century." This template will serve as a fallback when a more specific template (e.g. Taxonomy: Art) cannot be found.'=>'Ыңгайлуу таксономия архивин көрсөтөт. Категориялар жана энбелгилер үчүн таксономияларда сиз классификациялоо үчүн колдонгон терминдер бар. Мисалы: "Искусство" деп аталган таксономияда "Заманбап" жана "18-кылым" сыяктуу бир нече терминдер болушу мүмкүн. Бул шаблон конкреттүү шаблон (мисалы, Таксономия: Искусство) табылбай калганда резервдик көчүрмө катары кызмат кылат.','Displays a single author\'s post archive. This template will serve as a fallback when a more specific template (e.g. Author: Admin) cannot be found.'=>'Жалгыз автордун жазмаларынын архивин көрсөтөт. Бул шаблон атайын шаблон (мисалы, Автор: Админ) табылбай калганда, резерв катары кызмат кылат.','Displays any archive, including posts by a single author, category, tag, taxonomy, custom post type, and date. This template will serve as a fallback when more specific templates (e.g. Category or Tag) cannot be found.'=>'Ар бир архивди, анын ичинде жалгыз автордук жазмаларды, категорияларды, тегдерди, таксономияларды, колдонуучунун жазуусунун түрүн жана даталарын көрсөтөт. Бул шаблон, эгерде атайын шаблондор (категория же тег сыяктуу) табылбай калса, резервдик кызмат кылат.','Displays a post category archive. This template will serve as a fallback when a more specific template (e.g. Category: Recipes) cannot be found.'=>'Жазуунун категорияларынын архивин көрсөтөт. Бул шаблон атайын шаблон (мисалы, Категория: Рецепттер) табылбай калганда резервдик көчүрмө катары кызмат кылат.','Used as a fallback template for all pages when a more specific template is not defined.'=>'Эгерде кандайдыр бир атайын шаблон аныкталбаса, бардык барактар үчүн резервдик шаблон катары колдонулат.','Displays any single entry, such as a post or a page. This template will serve as a fallback when a more specific template (e.g. Single Post, Page, or Attachment) cannot be found.'=>'Жазуу же барак сыяктуу кандайдыр бир жазууну көрсөтөт. Бул шаблон, эгерде атайын шаблон (мисалы, бир жазма, барак же тиркеме сыяктуу) табылбаса, резерв катары кызмат кылат.','Displays your site\'s homepage, whether it is set to display latest posts or a static page. The Front Page template takes precedence over all templates.'=>'Соңку жазууларды же статикалык баракты көрсөтүү үчүн жөндөлгөнүнө карабастан, сайтыңыздын башкы бетин көрсөтөт. Башкы барактын шаблону бардык шаблондорго караганда артыкчылыкка ээ.','Displays the latest posts as either the site homepage or as the "Posts page" as defined under reading settings. If it exists, the Front Page template overrides this template when posts are shown on the homepage.'=>'Соңку жазууларды сайттын негизги бети же окуу жөндөөлөрүндө аныкталган "жазуу барагы" катары көрсөтөт. Эгер бар болсо, негизги беттеги жазуулар көрсөтүлгөндө, башкы барактын шаблону ошол шаблонду кайрадан аныктайт.','Block pattern categoryAbout'=>'Биз тууралуу','Block pattern categoryTeam'=>'Команда','Block pattern categoryPosts'=>'Жазмалар','Block pattern categoryBanners'=>'Баннерлер','block descriptionThe author name.'=>'Автордун аты.','block keywordpage'=>'барак','block titlePage List Item'=>'Барак тизмесинин элементи','block descriptionDisplays a page inside a list of all pages.'=>'Бардык барактардын тизмесинин ичиндеги баракты көрсөтөт.','block titleAuthor Name'=>'Автордун Аты','Style Variations'=>'Стилдин вариациялары','Position'=>'Орду','Sticky'=>'Жабыштырылган','https://wordpress.org/documentation/article/cookies/'=>'https://kir.wordpress.org/documentation/article/cookies/','https://wordpress.org/documentation/article/reset-your-password/'=>'https://wordpress.org/documentation/article/reset-your-password/','https://wordpress.org/documentation/article/site-editor/'=>'https://wordpress.org/documentation/article/site-editor/','Array of column names to be searched.'=>'Изд