ts in lists, grids or other layouts.'=>'Тизмеде, тордо же башка жайгашуу бөлүмдөрүндө соңку жазууларды көрсөтүү.','Patterns containing mostly text.'=>'Негизинен текстти камтыган паттерндер.','Multi-column patterns with more complex layouts.'=>'Бир нече мамычалар жана татаал белгилөөлөр бар паттерндер.','Patterns that contain buttons and call to actions.'=>'Баскычтар жана аракетке чакыруулар менен паттерндер.','User queries should not be run before the %s hook.'=>'Колдонуучунун сурамдары %s хукка чейин аткарылбашы керек.','The %s argument must be a string or a string array.'=>'%s аргументи сап же саптардын массиви болушу керек.','Sorry, you are not allowed to view terms for this post.'=>'Кечиресиз, сизге бул жазуу үчүн нерселерди көрүүгө укугуңуз жок.','Raw size value must be a string, integer, or float.'=>'Өлчөмдүн чийки мааниси сап, бүтүн сан же калкыма үтүр болушу керек.','block titleComments'=>'Комментарийлер','block descriptionCreate a list item.'=>'Тизме элементин түзүү.','block titleList item'=>'Тизме элементи','block titleComments Previous Page'=>'Комментарийлердин мурунку барагы','block titleComments Page Numbers'=>'Комментарий барактарынын номерлери','block titleCategories List'=>'Категориялардын тизмеси','block titleComments Next Page'=>'Комментарийлердин кийинки барагы','Default template'=>'Базалык шаблон','%s comment'=>'%s комментарий','Site Domain (subdomain only):'=>'Вебсайт домени (субдомен гана):','Site Name (subdirectory only):'=>'Сайттын аталышы (ички каталог гана):','Create a site or only a username:'=>'Сайт же колдонуучунун атын гана түзүү:','There doesn\'t seem to be a %s file. It is needed before the installation can continue.'=>'%s файлы жок окшойт. Бул орнотууну улантуу үчүн талап кылынат.','The date and time the preferences were updated.'=>'Орнотуулар жаңыртылган датасы жана убактысы.','Whether the theme disables generated layout styles.'=>'Тема түзүлгөн макет стилдерин өчүрүп салабы.','Whether a theme uses block-based template parts.'=>'Темада блокторго негизделген шаблон бөлүктөрү барбы.','$store must be an instance of WP_Style_Engine_CSS_Rules_Store'=>'$store WP_Style_Engine_CSS_Rules_Store мисал болушу керек','Revisions not enabled.'=>'Чыгаруулар өчүрүлгөн.','The template prefix for the created template. This is used to extract the main template type, e.g. in `taxonomy-books` extracts the `taxonomy`'=>'Түзүлгөн шаблон үчүн префикс. Негизги шаблондун түрүн алуу үчүн колдонулат. Мисалы, «таксономия-китеп» учурда бул «таксономия» болмок.','Indicates if a template is custom or part of the template hierarchy'=>'Шаблон колдонуучунун же шаблон иерархиясынын бир бөлүгү экендигин көрсөтөт','The slug of the template to get the fallback for'=>'Камдык көчүрмөнү алуу керек болгон шаблон жарлыгы','The icon for the post type.'=>'Жазуу түрү үчүн сөлөкөт.','If the value is a string, the value will be used as the archive slug. If the value is false the post type has no archive.'=>'Эгер маани сап болсо, ал архив энбелгиси катары колдонулат. Эгерде маани «жалган» болсо, анда жазуу түрүнүн архиви жок.','Public facing and editor style handle. DEPRECATED: Use `style_handles` instead.'=>'Жалпыга жеткиликтүүлүк жана түзөтүү стили үчүн дескриптору. ЭСКИРГЕН: Анын ордуна `style_handles` колдонуңуз.','Editor style handle. DEPRECATED: Use `editor_style_handles` instead.'=>'Түзөтүү стили үчүн дескриптору. ЭСКИРГЕН: Анын ордуна `editor_style_handles` колдонуңуз.','Public facing script handle. DEPRECATED: Use `view_script_handles` instead.'=>'Жалпыга жеткиликтүүлүк дескриптору. ЭСКИРГЕН: Анын ордуна `view_script_handles` колдонуңуз.','Public facing and editor script handle. DEPRECATED: Use `script_handles` instead.'=>'Жалпыга жеткиликтүүлүк  жана түзөтүү үчүн дескриптору. ЭСКИРГЕН: Анын ордуна `script_handles` колдонуңуз.','Editor script handle. DEPRECATED: Use `editor_script_handles` instead.'=>'Скрипттин түзөтүү үчүн дескриптору. ЭСКИРГЕН: Анын ордуна `editor_script_handles` колдонуңуз.','An array of post types that the pattern is restricted to be used with.'=>'Паттернди колдонууда чектелген жазуу түрлөрүнүн массиви.','REST API %1$s should be an array of arrays. Non-array value detected for %2$s.'=>'REST API %1$s массивдердин массиви болушу керек. %2$s үчүн массивден тышкары маани табылды.','If you are the owner of this network please check that your host&#8217;s database server is running properly and all tables are error free.'=>'Эгер сиз тармактын администратору болсоңуз, анда MySQL кызматы иштеп жатканын жана таблицаларда каталар жок экендигин текшериңиз.','*'=>'*','<strong>Conflicting values for the constants %1$s and %2$s.</strong> The value of %2$s will be assumed to be your subdomain configuration setting.'=>'<strong>%1$s жана %2$s константалары үчүн карама-каршы маанилер.</strong> %2$s мааниси субдомениңиз үчүн конфигурация жөндөөсү деп болжолдонууда.','Logged in as %1$s. <a href="%2$s">Edit your profile</a>. <a href="%3$s">Log out?</a>'=>'Сиз %1$s катары кирдиңиз. <a href="%2$s">Профилди түзөтүү</a>. <a href="%3$s">Чыгасызбы?</a>','%sX-Large'=>'%sX-Чоң','%sX-Small'=>'%sX-Кичине','Your %1$s file uses a dynamic value (%2$s) for the path at %3$s. However, the value at %3$s is also a dynamic value (pointing to %4$s) and pointing to another dynamic value is not supported. Please update %3$s to point directly to %4$s.'=>'%1$s файлыңыз %3$s жолу үчүн динамикалык маанини (%2$s) колдонууда. Бирок, %3$s ичиндеги маани да динамикалык маани (%4$s көрсөтүүчү) жана башка динамикалык маанини көрсөтүү колдоого алынбайт. Түздөн-түз %4$s көрсөтүү үчүн %3$s жаңыртыңыз.','put your unique phrase here'=>'бул жерге уникалдуу фразаны киргизиңиз','Cache key must not be an empty string.'=>'Кэш ачкычы бош сап болбошу керек.','There has been a critical error on this website. Please reach out to your site administrator, and inform them of this error for further assistance.'=>'Сайт өтө олуттуу катага туш болду. Сураныч, сайтыңыздын администратору менен байланышып, кошумча жардам алуу үчүн бул ката тууралуу кабарлаңыз.','When checking for the %s capability, you must always check it against a specific user.'=>'%s мүмкүнчүлүгүн текшергенде, аны ар дайым белгилүү бир колдонуучу менен текшерип турушуңуз керек.','When checking for the %s capability, you must always check it against a specific term.'=>'%s мүмкүнчүлүгүн текшергенде, аны ар дайым белгилүү бир элемент менен текшерип турушуңуз керек.','When checking for the %s capability, you must always check it against a specific comment.'=>'%s мүмкүнчүлүгүн текшергенде, аны ар дайым белгилүү бир комментарий менен текшерип турушуңуз керек.','Cache key must be an integer or a non-empty string, %s given.'=>'Кэш ачкычы бүтүн сан же бош эмес сап болушу керек, %s берилген.','Template for %s'=>'%s үчүн шаблон','Deleted author: %s'=>'Өчүрүлгөн автор: %s','Not found: %1$s (%2$s)'=>'Табылган жок: %1$s (%2$s)','When checking for the %s capability, you must always check it against a specific page.'=>'%s мүмкүнчүлүгүн текшергенде, аны ар дайым белгилүү бир барак менен текшерип турушуңуз керек.','When checking for the %s capability, you must always check it against a specific post.'=>'%s мүмкүнчүлүгүн текшергенде, аны ар дайым белгилүү бир жазуу менен текшерип турушуңуз керек.','Your object cache implementation does not support flushing individual groups.'=>'Объект кэшин ишке ашыруу айрым топторду баштапкы абалга келтирүүнү колдобойт.','Your object cache implementation does not support flushing the in-memory runtime cache.'=>'Сиздин объект кэшин ишке ашыруу аткаруу убагында эстутумдагы кэшти тазалоону колдобойт.','Cron unschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'Хук үчүн Cron окуясын жокко чыгаруу катасы: %1$s, Ката коду: %2$s, ката тууралуу билдирүү: %3$s, Дайындар: %4$s','Cron reschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'Хук үчүн Cron окуясын кайра пландоо катасы: %1$s, Ката коду: %2$s, ката тууралуу билдирүү: %3$s, Дайындар: %4$s','Block