e browser title bar and in search results.'=>'Сайттын атын көрсөтөт. Блокту жаңыртыңыз жана өзгөртүүлөр ал колдонулган жерде колдонулат. Бул ошондой эле браузердин аталыш тилкесинде жана издөө натыйжаларында пайда болот.','block style labelPlain'=>'Жөнөкөй','block titlePagination'=>'Номурлоо','block titlePrevious Page'=>'Мурунку бет','block titlePage Numbers'=>'Барактын номерлери','block titleNext Page'=>'Кийинки бет','block descriptionDisplays the next or previous post link that is adjacent to the current post.'=>'Учурдагы жазуунун жанында жайгашкан кийинки же мурунку жазуунун шилтемесин көрсөтөт.','block titlePost Navigation Link'=>'Жазуу багыттоосу үчүн шилтеме','block descriptionDisplay a post\'s comments form.'=>'Жазуу үчүн комментарий формасын көрсөтөт.','block titleNavigation'=>'Багыттоо','block descriptionA collection of blocks that allow visitors to get around your site.'=>'Конокторго сиздин сайтка кирүүгө мүмкүндүк берген блоктордун жыйнагы.','block descriptionAdd a page, link, or another item to your navigation.'=>'Багыттоого баракты, шилтемени же башка элементти кошот.','block titlePattern'=>'Паттерн','block descriptionAdd a submenu to your navigation.'=>'Сайттын багыттоосуна суб-менюну кошуу.','block titleSubmenu'=>'Суб-меню','block titleCustom Link'=>'Кошумча шилтеме','block descriptionShow a block pattern.'=>'Блоктордун паттернин көрсөтүү.','block titleComments Form'=>'Комментарий формасы','block descriptionDisplay content in multiple columns, with blocks added to each column.'=>'Ар бир тилкеге ​​блоктор кошулуп, мазмунду бир нече тилкеде көрсөтүңүз.','No comments'=>'Комментарий жок','Confirm'=>'Ырастоо','Could not strip invalid text.'=>'Туура эмес текст өчүрүлгөн жок.','Could not retrieve table charset.'=>'Таблицанын коддоосу алынган жок.','WordPress database error: Processing the values for the following fields failed: %s. The supplied values may be too long or contain invalid data.'=>'WordPress маалымат базасынын катасы: Төмөнкү т