###DETAILS###'=>'Саламатсызбы!

WordPressте плагин же тема сиздин сайтыңызда ката кетирип жатканын аныктап, email аркылуу автоматтык түрдө жөнөтөт.
###CAUSE###
Алгач сайтыңызга барыңыз (###SITEURL###) жана көрүнгөн көйгөйлөр бар-жогун текшериңиз. Андан кийин ката кеткен бетке өтүңүз (###PAGEURL###) жана андагы көрүнүп турган көйгөйлөрдү текшериңиз.

###SUPPORT###

Эгер сиздин сайт бузулуп, консолго кире албасаңыз, WordPress азыр атайын "калыбына келтирүү режимине" ээ. Бул сиздин башкаруу панелиңизге аман-эсен кирип, андан ары иликтөөгө мүмкүндүк берет.

###LINK###

Сайтыңыздын коопсуздугу үчүн бул шилтеменин мөөнөтү ###EXPIRES### ичинде бүтөт. Бирок, бул жөнүндө кабатыр болбоңуз: эгер ката мөөнөтү аяктагандан кийин дагы кайталанса, сизге жаңы шилтеме email аркылуу жөнөтүлөт.

Бул маселе боюнча жардам сураганда, сизден төмөнкү маалыматтардын айрымдары суралышы мүмкүн:
