деалдуу түрдө туура келгидей кылып кесилиши мүмкүн.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Компьютерден сүрөт файлын жүктөө үчүн, &#8220;Медианы кошуу&#8221; басыңыз. Темаңыздын өлчөмү %s пиксел болгон баш аталыш сүрөтү менен эң сонун көрүнөт. Жүктөлгөндөн кийин, сүрөт идеалдуу түрдө туура келгидей кылып кесилиши мүмкүн.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Компьютерден сүрөт файлын жүктөө үчүн, &#8220;Медианы кошуу&#8221; басыңыз. Темаңыз видеонун өлчөмүнө дал келген сүрөт менен эң сонун көрүнөт. &#8212; Сүрөттү жүктөгөндөн кийин, сиз аны кемчиликсиз тууралоо үчүн кесип аласыз.','Meridian'=>'Меридиан','Minute'=>'Мүнөт','Hour'=>'Саат','Time'=>'Убакыт','Day'=>'Күн','Month'=>'Ай','Date'=>'Дата','Name for the Visual editor tabVisual'=>'Көрүнүктүү','Create New Menu'=>'Жаңы меню жаратуу','New Menu'=>'Жаңы меню','%1$s-%2$s'=>'%1$s-%2$s','Usage of user levels is deprecated. Use capabilities instead.'=>'Колдонуучулар үчүн деңгээлдерди колдонуу эскирген. Мүмкүнчүлүктөрдү колдонуңуз.','The theme defines itself as its parent theme. Please check the %s header.'=>'Тема өзүн өзү үчүн энелик тема катары аныктайт. Сураныч, %s аталышын текшериңиз.','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Эгерде сиз колдонуп жаткан темада виджет аймактары бар болсо, анда менюну да кошо аласыз. <a href="%s">Виджеттердин Башкаруу панелине</a> өтүп, менюну каптал тилкесинде же төмөнкү бөлүмдө көрсөтүү үчүн &#8220;Багыттоо менюсунун виджетин&#8221; кошуңуз.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'Эгерде сиздин темаңыз бир нече менюну колдосо, так аталыштар аларды башкарууга жардам берет.','Your theme can display menus in %s location.'=>'Сиздин темаңыз %s жайгашкан жерде менюну көрсөтүшү мүмкүн.','Your theme can display menus in one location.'=>'Сиздин тема менюну бир жерден көрсөтө алат.','CSS code'=>'CSS коду','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'Түзөтүү талаасы коддун синтаксисин автоматтык түрдө бөлүп көрсөтөт. Сиз муну <a href="%1$s" %2$s>user%3$s</a> профилиңизден өчүрүп, кадимки текст сыяктуу иштей аласыз.','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'Экрандан окуу программасын колдонууда: Формалар көрүнүшүндө Esc баскычын эки жолу басышыңыз керек болот.','To move away from this area, press the Esc key followed by the Tab key.'=>'Бул аймактан чыгуу үчүн Esc, андан кийин Tab баскычын басыңыз.','In the editing area, the Tab key enters a tab character.'=>'Түзөтүү аймагында, баскыч Tab табуляциянын символун киргизет.','When using a keyboard to navigate:'=>'Багыттоо үчүн клавиатураны колдонууда:','Add your own CSS code here to customize the appearance and layout of your site.'=>'Сайтыңыздын көрүнүшүн жана макетин ыңгайлаштыруу үчүн өзүңүздүн CSS кодуңузду кошуңуз.','Your homepage displays'=>'Негизги бетте көрсөтүү','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'Сиз сайтыңыздын башкы бетинде эмне көрсөтүлөрүн тандай аласыз. Бул тескери хронологиялык билдирүүлөр (классикалык блог) же туруктуу/статикалык баракча болушу мүмкүн. Статикалык башкы бетти орнотуу үчүн эки баракты түзүшүңүз керек. Бири башкы баракчага айланат, экинчиси сиздин билдирүүлөрүңүздү көрсөтөт.','Homepage Settings'=>'Негизги бет жөндөөлөрү','WordPress.org themes'=>'WordPress.org темалары','Installed themes'=>'Орнотулган темалар','Copied'=>'Көчүрүлдү','Publish Settings'=>'Жарыялоо жөндөөлөрү','Preview Link'=>'Алдын ала көрүү үчүн шилтеме','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'Өзгөртүүлөр сиздин сайтыңызда кантип түзөөрүн көрүңүз жана жөндөөлөргө кирүү мүмкүнчүлүгү жок адамдар менен алдын ала көрүүнү бөлүшүңүз.','Share Preview Link'=>'Алдын ала көрүү шилтемеси менен бөлүшүү','Changes trashed successfully.'=>'Өзгөртүүлөр таштандыга чыгарылды.','Changes have already been trashed.'=>'Өзгөртүүлөр мурунтан эле таштандыга ташталган.','Unable to trash changes.'=>'Таштандыга киргизилген өзгөртүүлөрдү өчүрүү ийгиликсиз.','No changes saved yet, so there is nothing to trash.'=>'Эч кандай өзгөртүүлөр сакталган жок, андыктан өчүрө турган эч нерсе жок.','There was an authentication problem. Please reload and try again.'=>'Авторизацияда көйгөй келип чыкты. Сураныч, кайра жүктөп, дагы аракет кылыңыз.','Unable to save due to %s invalid setting.'=>'%s туура эмес жөндөөдөн улам сакталбай калды.','You must supply a future date to schedule.'=>'Сиз пландаштыруу үчүн келечектеги датаны белгилешиңиз керек.','View User'=>'Колдонуучуну көрүү','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'Өзгөртүүлөрдүн мурунку жыйнагы жарыяланган. Сураныч, учурдагы өзгөртүүлөр жыйнагыңызды кайра сактап көрүңүз.','Edit User'=>'Колдонуучуну түзөтүү','This widget may have contained code that may work better in the &#8220;Custom HTML&#8221; widget. If you have not yet, how about trying that widget instead?'=>'Бул виджет жаңы виджет менен жакшыраак иштей турган кодду камтышы мүмкүн &#8220;HTML-код&#8221; Аны колдонуп көрсөк кандай болот?','Hey there, looks like you just pasted HTML into the &#8220;Visual&#8221; tab of the Text widget. You may want to paste your code into the &#8220;Text&#8221; tab instead. Alternately, try out the new &#8220;Custom HTML&#8221; widget!'=>'Сиз «Текст» виджетинин «Визуалдык» табына жөн гана HTML тыштаган окшойсун. Мунун ордуна өзүңүздүн кодуңузду «Текст» табына тыштаңыз. Альтернатива катары жаңы «Колдонуучулук HTML» виджетин колдонуңуз!','Did you just paste HTML?'=>'Сиз жаңы эле HTML киргиздиңизби?','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by scanning the list of available widgets on this screen. Check it out to add some custom code to your site!'=>'Сиз бизде азыр «Колдонуучулук HTML» виджети бар экенин билесизби? Сиз аны бул экрандагы жеткиликтүү виджеттердин тизмесинен таба аласыз. Сайтыңызга колдонуучулук кодду кошуу үчүн аны текшериңиз!','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by pressing the &#8220;<a class="add-widget" href="#">Add a Widget</a>&#8221; button and searching for &#8220;HTML&#8221;. Check it out to add some custom code to your site!'=>'Сиз бизде азыр «Колдонуучулук HTML» виджети бар экенин билесизби? Сиз аны  "<a class="add-widget" href="#"> Виджет кошуу </a>" баскычын басып, «HTML» деп издеп таба аласыз. Сайтыңызга колдонуучулук кодду кошуу үчүн аны текшериңиз!','New Custom HTML Widget'=>'Жаңы Колдонуучулук HTML Виджети ','Arbitrary text.'=>'Эркин текст.','This widget may contain code that may work better in the &#8220;Custom HTML&#8221; widget. How about trying that widget instead?'=>'Бул виджет жаңы «HTML-коду» виджетине ылайыктуу кодду камтыйт. Аны колдонуп көрүүгө кандай карайсыз?','Custom HTML'=>'HTML-код','Arbitrary HTML code.'=>'Кошумча HTML коду.','Some HTML tags are not permitted, including:'=>'Кээ бир HTML тэгдерине жол берилбейт, анын ичинде:','Show tag counts'=>'Тегдердин санын көрсөтүү','%s item'=>'%s элемент','label for button in the media widgetAdd Media'=>'Медиафайл кошуу',